import "./styles.css";
import { get } from "./axios";
import React, { useState, useEffect } from "react";
import Table from "./table";

export default function App() {
  const [songs, setReleases] = useState([]);
  const headerConfig = [
    {
      name: "Label",
      keyValue: "label",
      width: "30%",
    },
    {
      name: "Title",
      keyValue: "title",
      width: "30%",
    },
    {
      name: "Track Info",
      keyValue: "trackinfo",
      width: "30%",
    },
    {
      name: "Year",
      keyValue: "year",
      width: "10%",
    },
  ];
  useEffect(() => {
    get("artists/1/releases", "page=2&per_page=75").then((response) => {
      const {
        data: { releases },
      } = response;
      setReleases(releases);
    });
  }, []);

  return (
    <div className="App">
      <Table headerConfig={headerConfig} releasesData={songs}></Table>
    </div>
  );
}
